import React, { Component } from "react";


class Connection extends Component {

    init_connection(){
        var ros = new window.ROSLIB.Ros(); //window must be used because package is called from index.html
    }

    render() {
        return (
            <div>
                <h2>Connection</h2>;
            </div>
        );

    }
}

export default Connection;
